import React, { Component } from 'react'
import { InfoConsumer  } from '../Context';


 class Home extends Component {
    render() {
        return (
           <InfoConsumer>
               {(data) => {
                   return <h2>{data}</h2>
               }}

           </InfoConsumer>
        )
    }
}
import { format } from 'util'
export default Home;
